    "body": "Bumps [ember-test-selectors](https://github.com/simplabs/ember-test-selectors) from 4.1.0 to 5.0.0.\n<details>\n<summary>Changelog</summary>\n<p><em>Sourced from <a href=\"https://github.com/simplabs/ember-test-selectors/blob/master/CHANGELOG.md\">ember-test-selectors's changelog</a>.</em></p>\n<blockquote>\n<h2>v5.0.0 (2020-09-02)</h2>\n<p>This release drops support for Ember.js versions below v3.8 due to an update\nof ember-cli-htmlbars which did the same. Other than that, no further breaking\nchanges are contained in the release.</p>\n<h4>:boom: Breaking Change</h4>\n<ul>\n<li><a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/pull/527\">#527</a> Bump ember-cli-htmlbars from 4.3.1 to 5.1.2 (<a href=\"https://github.com/marcoow\">@marcoow</a>)</li>\n</ul>\n<h4>:rocket: Enhancement</h4>\n<ul>\n<li><a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/pull/587\">#587</a> bind-data-test-attributes: Avoid deprecated <code>getWithDefault()</code> call (<a href=\"https://github.com/Turbo87\">@Turbo87</a>)</li>\n</ul>\n<h4>:memo: Documentation</h4>\n<ul>\n<li><a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/pull/588\">#588</a> Update Node.js and Ember.js support documentation (<a href=\"https://github.com/Turbo87\">@Turbo87</a>)</li>\n</ul>\n<h4>Committers: 2</h4>\n<ul>\n<li>Marco Otte-Witte (<a href=\"https://github.com/marcoow\">@marcoow</a>)</li>\n<li>Tobias Bieniek (<a href=\"https://github.com/Turbo87\">@Turbo87</a>)</li>\n</ul>\n</blockquote>\n</details>\n<details>\n<summary>Commits</summary>\n<ul>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/27333958faf1f020b28fdbc28409a83c14aed5fc\"><code>2733395</code></a> v5.0.0</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/cc0ac0df42dfd3570663420f31007d82327f197f\"><code>cc0ac0d</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/issues/588\">#588</a> from Turbo87/support</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/497fb520c3ab37c432c5a57048c7b1a92252c57f\"><code>497fb52</code></a> Merge pull request <a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/issues/578\">#578</a> from simplabs/dependabot/npm_and_yarn/eslint-7.7.0</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/0578917d41eeb4561772549dbefcd72197ff2762\"><code>0578917</code></a> README: Update &quot;Compatibility&quot; section</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/05fa8b6656262c0937d5e361953fd08f6b255653\"><code>05fa8b6</code></a> package.json: Update <code>versionCompatibility</code> field</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/9c0d6346eb8193468378d9945aa29cfa63835960\"><code>9c0d634</code></a> bind-data-test-attributes: Avoid deprecated <code>getWithDefault()</code> call (<a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/issues/587\">#587</a>)</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/162009b8f792fbe3ac568197339f1e86f202d213\"><code>162009b</code></a> ESLint: Add <code>.eslintrc.js</code> file to Node.js files</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/a6cc534bebbc6afa3163f9803fa427c426025773\"><code>a6cc534</code></a> Bump eslint from 6.8.0 to 7.7.0</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/c0537684649f2010e7702aa31fbc6242d6440e6e\"><code>c053768</code></a> Bump eslint-plugin-qunit from 4.3.0 to 5.0.0 (<a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/issues/584\">#584</a>)</li>\n<li><a href=\"https://github.com/simplabs/ember-test-selectors/commit/94c3c6c053e361fb4607ce1ee932def3eac64c6d\"><code>94c3c6c</code></a> Bump ember-source from 3.20.4 to 3.21.1 (<a href=\"https://github-redirect.dependabot.com/simplabs/ember-test-selectors/issues/586\">#586</a>)</li>\n<li>Additional commits viewable in <a href=\"https://github.com/simplabs/ember-test-selectors/compare/v4.1.0...v5.0.0\">compare view</a></li>\n</ul>\n</details>\n<br />\n\n\n[![Dependabot compatibility score](https://api.dependabot.com/badges/compatibility_score?dependency-name=ember-test-selectors&package-manager=npm_and_yarn&previous-version=4.1.0&new-version=5.0.0)](https://dependabot.com/compatibility-score/?dependency-name=ember-test-selectors&package-manager=npm_and_yarn&previous-version=4.1.0&new-version=5.0.0)\n\nDependabot will resolve any conflicts with this PR as long as you don't alter it yourself. You can also trigger a rebase manually by commenting `@dependabot rebase`.\n\n[//]: # (dependabot-automerge-start)\n[//]: # (dependabot-automerge-end)\n\n---\n\n<details>\n<summary>Dependabot commands and options</summary>\n<br />\n\nYou can trigger Dependabot actions by commenting on this PR:\n- `@dependabot rebase` will rebase this PR\n- `@dependabot recreate` will recreate this PR, overwriting any edits that have been made to it\n- `@dependabot merge` will merge this PR after your CI passes on it\n- `@dependabot squash and merge` will squash and merge this PR after your CI passes on it\n- `@dependabot cancel merge` will cancel a previously requested merge and block automerging\n- `@dependabot reopen` will reopen this PR if it is closed\n- `@dependabot close` will close this PR and stop Dependabot recreating it. You can achieve the same result by closing it manually\n- `@dependabot ignore this major version` will close this PR and stop Dependabot creating any more for this major version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this minor version` will close this PR and stop Dependabot creating any more for this minor version (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot ignore this dependency` will close this PR and stop Dependabot creating any more for this dependency (unless you reopen the PR or upgrade to it yourself)\n- `@dependabot use these labels` will set the current labels as the default for future PRs for this repo and language\n- `@dependabot use these reviewers` will set the current reviewers as the default for future PRs for this repo and language\n- `@dependabot use these assignees` will set the current assignees as the default for future PRs for this repo and language\n- `@dependabot use this milestone` will set the current milestone as the default for future PRs for this repo and language\n- `@dependabot badge me` will comment on this PR with code to add a \"Dependabot enabled\" badge to your readme\n\nAdditionally, you can set the following in your Dependabot [dashboard](https://app.dependabot.com):\n- Update frequency (including time of day and day of week)\n- Pull request limits (per update run and/or open at any time)\n- Automerge options (never/patch/minor, and dev/runtime dependencies)\n- Out-of-range updates (receive only lockfile updates, if desired)\n- Security updates (receive only security updates, if desired)\n\n\n\n</details>",
