    "body": "This PR contains the following updates:\n\n| Package | Type | Update | Change |\n|---|---|---|---|\n| [ember-cli-code-coverage](https://togithub.com/kategengler/ember-cli-code-coverage) | devDependencies | patch | [`1.0.0-beta.9` -> `1.0.0`](https://renovatebot.com/diffs/npm/ember-cli-code-coverage/1.0.0-beta.9/1.0.0) |\n\n---\n\n### Release Notes\n\n<details>\n<summary>kategengler/ember-cli-code-coverage</summary>\n\n### [`v1.0.0`](https://togithub.com/kategengler/ember-cli-code-coverage/blob/master/CHANGELOG.md#v100-2020-08-31)\n\n[Compare Source](https://togithub.com/kategengler/ember-cli-code-coverage/compare/v1.0.0-beta.9...v1.0.0)\n\n##### :boom: Breaking Change\n\n-   [#&#8203;252](https://togithub.com/kategengler/ember-cli-code-coverage/pull/252) Drop Node 8 and 11 support. ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n\n##### :rocket: Enhancement\n\n-   [#&#8203;263](https://togithub.com/kategengler/ember-cli-code-coverage/pull/263) Remove deprecated istanbul-api package. ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;261](https://togithub.com/kategengler/ember-cli-code-coverage/pull/261) Replace `extend` package with `Object.assign` ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;259](https://togithub.com/kategengler/ember-cli-code-coverage/pull/259) Remove lodash.concat dependency ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;258](https://togithub.com/kategengler/ember-cli-code-coverage/pull/258) Remove RSVP dependency. ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;255](https://togithub.com/kategengler/ember-cli-code-coverage/pull/255) Update dependencies to latest ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n\n##### :bug: Bug Fix\n\n-   [#&#8203;262](https://togithub.com/kategengler/ember-cli-code-coverage/pull/262) Fix issue with coverage report. ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;260](https://togithub.com/kategengler/ember-cli-code-coverage/pull/260) Ensure coverage build is parallelizable ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;257](https://togithub.com/kategengler/ember-cli-code-coverage/pull/257) Remove unused babel-plugin-transform-async-to-generator package ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;248](https://togithub.com/kategengler/ember-cli-code-coverage/pull/248) test cases fail with --path option in 1.0.0-beta.8 version ([@&#8203;abishek-srinivasan](https://togithub.com/abishek-srinivasan))\n-   [#&#8203;251](https://togithub.com/kategengler/ember-cli-code-coverage/pull/251) fix `InvalidStateError` exception ([@&#8203;brokenalarms](https://togithub.com/brokenalarms))\n\n##### :memo: Documentation\n\n-   [#&#8203;273](https://togithub.com/kategengler/ember-cli-code-coverage/pull/273) Update instructions for Typescript integration to use 1.0.0-beta.9 ([@&#8203;tomichal](https://togithub.com/tomichal))\n\n##### :house: Internal\n\n-   [#&#8203;282](https://togithub.com/kategengler/ember-cli-code-coverage/pull/282) Use `.includes()` instead of `.indexOf()` ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;281](https://togithub.com/kategengler/ember-cli-code-coverage/pull/281) Simplify `_isCoverageEnabled()` method ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;280](https://togithub.com/kategengler/ember-cli-code-coverage/pull/280) Remove unused `_parentName()` method ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;279](https://togithub.com/kategengler/ember-cli-code-coverage/pull/279) tests: Use async/await ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;278](https://togithub.com/kategengler/ember-cli-code-coverage/pull/278) mocha: Remove unnecessary Babel integration ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;277](https://togithub.com/kategengler/ember-cli-code-coverage/pull/277) Use shorthand methods and named functions ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;274](https://togithub.com/kategengler/ember-cli-code-coverage/pull/274) Use Prettier for code formatting ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;276](https://togithub.com/kategengler/ember-cli-code-coverage/pull/276) Use GitHub Actions for CI/CD ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;272](https://togithub.com/kategengler/ember-cli-code-coverage/pull/272) Fix `node-tests` ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [#&#8203;256](https://togithub.com/kategengler/ember-cli-code-coverage/pull/256) Remove `co` usage ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;254](https://togithub.com/kategengler/ember-cli-code-coverage/pull/254) Migrate to more modern linting setup. ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;253](https://togithub.com/kategengler/ember-cli-code-coverage/pull/253) Update release process ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   [#&#8203;249](https://togithub.com/kategengler/ember-cli-code-coverage/pull/249) Update to 3.16 ember-cli blueprint ([@&#8203;rajasegar](https://togithub.com/rajasegar))\n\n##### Committers: 6\n\n-   Daniel ([@&#8203;brokenalarms](https://togithub.com/brokenalarms))\n-   Rajasegar Chandran ([@&#8203;rajasegar](https://togithub.com/rajasegar))\n-   Robert Jackson ([@&#8203;rwjblue](https://togithub.com/rwjblue))\n-   Tobias Bieniek ([@&#8203;Turbo87](https://togithub.com/Turbo87))\n-   [@&#8203;tomichal](https://togithub.com/tomichal)\n-   abishek-srinivasan ([@&#8203;abishek-srinivasan](https://togithub.com/abishek-srinivasan))\n\n</details>\n\n---\n\n### Renovate configuration\n\n:date: **Schedule**: At any time (no schedule defined).\n\n:vertical_traffic_light: **Automerge**: Disabled by config. Please merge this manually once you are satisfied.\n\n:recycle: **Rebasing**: Whenever PR becomes conflicted, or you tick the rebase/retry checkbox.\n\n:no_bell: **Ignore**: Close this PR and you won't be reminded about this update again.\n\n---\n\n - [ ] <!-- rebase-check -->If you want to rebase/retry this PR, check this box\n\n---\n\nThis PR has been generated by [WhiteSource Renovate](https://renovate.whitesourcesoftware.com). View repository job log [here](https://app.renovatebot.com/dashboard#github/adopted-ember-addons/ember-file-upload).",
